class binding_and_energy_nussinov:

	def couple(self, pair):
		"""
		Return True if RNA nucleotides are Watson-Crick base pairs
		"""
		pairs = {"A": "U", "U": "A", "G": "C", "C": "G"} # ...or a list of tuples...

		# check if pair is couplable
		if pair in pairs.items():
			return True

		return False

	def energy(self, pair):
		energy_pairs = {("G", "C"): -5, ("C", "G"): -5, ("A", "U"): -4, ("U", "A"): -4, ("G", "U"): -1, ("U", "G"): -1}

		if (pair in energy_pairs):
			return energy_pairs[pair]

		return 0

	def match_(self, seq, target):
		score = 0
		for i in range(len(seq)):
			if seq[i] == target[i]:
				score += 1
		return score

	def search_bp(self, rna, binding_site):
		l = len(binding_site)
		bp = {}

		for i in range(len(rna) - (l - 1)):
			seq = rna[i:i+l]
			score = self.match_(seq, binding_site)
			bp[(i, i+l)] = score

		return max(bp, key=bp.get)

	def search_all_bp(self, rna, binding_sites):
		indices = []
		for site in binding_sites:
			bp = self.search_bp(rna, site)
			indices += list(range(bp[0], bp[1]))
		return indices

	def fill(self, nm, bp_idxs, rna, minimal_loop_length):
		"""
		Fill the matrix as per the Nussinov algorithm
		"""

		for k in range(1, len(rna)):
			for i in range(len(rna) - k):
				j = i + k

				if j - i >= minimal_loop_length:
					down = nm[i + 1][j] # 1st rule
					left = nm[i][j - 1] # 2nd rule
					if (i in bp_idxs or j in bp_idxs):
						diag = 0
					else:
						diag = nm[i + 1][j - 1] + self.energy((rna[i], rna[j])) # 3rd rule

					rc = min([nm[i][t] + nm[t + 1][j] for t in range(i, j)]) # 4th rule

					nm[i][j] = min(down, left, diag, rc) # min of all

				else:
					nm[i][j] = 0

		return nm

	def traceback(self, nm, rna, fold, i, L):
		"""
		Traceback through complete Nussinov matrix to find optimial RNA secondary structure solution through max base-pairs
		"""
		j = L

		if i < j:
			if nm[i][j] == nm[i + 1][j]: # 1st rule
				self.traceback(nm, rna, fold, i + 1, j)
			elif nm[i][j] == nm[i][j - 1]: # 2nd rule
				self.traceback(nm, rna, fold, i, j - 1)
			elif nm[i][j] == nm[i + 1][j - 1] + self.energy((rna[i], rna[j])): # 3rd rule
				fold.append((i, j))
				self.traceback(nm, rna, fold, i + 1, j - 1)
			else:
				for k in range(i + 1, j - 1):
					if nm[i][j] == nm[i, k] + nm[k + 1][j]: # 4th rule
						self.traceback(nm, rna, fold, i, k)
						self.traceback(nm, rna, fold, k + 1, j)
						break

		return fold

	def dot_write(self, rna, fold, bound):
		dot = ["." for i in range(len(rna))]

		for i in bound:
			dot[i] = "*"

		for s in fold:
			#print(min(s), max(s))
			dot[min(s)] = "("
			dot[max(s)] = ")"

		return "".join(dot)

	def init_matrix(self, rna):
		M = len(rna)

		# init matrix
		nm = np.empty([M, M])
		nm[:] = np.NAN

		# init diaganols to 0
		# few ways to do this: np.fill_diaganol(), np.diag(), nested loop, ...
		nm[range(M), range(M)] = 0
		nm[range(1, len(rna)), range(len(rna) - 1)] = 0

		return nm

	def run(self, rna, binding_sites, verbose, minimal_loop_length):
		# rna = "CUCGGAGGGUCCCGAC"
		# binding_sites = ["GGGUC"]

		nm = self.init_matrix(rna)
		bp_indices = self.search_all_bp(rna, binding_sites)

		nm = self.fill(nm, bp_indices, rna, minimal_loop_length)

		fold = []
		sec = self.traceback(nm, rna, fold, 0, len(rna) - 1)

		res = self.dot_write(rna, fold, bp_indices)

		names = [_ for _ in rna]
		df = pd.DataFrame(nm, index = names, columns = names)

		if verbose:
			print(df, "\n", rna, fold, res)

		return fold



