"""###Function to get base pairs from dot notation"""

def get_pairs_from_dot(fold):
    stack = []
    pairings = []

    for i, char in enumerate(fold):
        if char == '(':
            stack.append(i)
        elif char == ')':
            if stack:
                opening_index = stack.pop()
                pairings.append((opening_index, i))

    return pairings

"""###Function to evaluate base pair prediction accuracy"""

def evaluate_acc(observed_structure, predicted_structure, verbose):

  #order list of tuples / base pairs
  obs_ord = sorted(observed_structure)
  pred_ord = sorted(predicted_structure)

  correct = 0
  for bp in pred_ord:
    if bp in obs_ord:
      correct+=1

  if verbose:
    print(f'predicted base pairs : {pred_ord}')

  return correct / len(obs_ord)


