"""
Nussinov-Jacobson python algorithm implementation
	Predicts the secondary RNA structure from an RNA sequence.
	The minimal loop length is set to a default of 0

Source: https://bayesianneuron.com/2019/02/nussinov-predict-2nd-rna-fold-structure-algorithm/
"""

import numpy as np
import pandas as pd  # you can remove this... it's just for nice output (matrix formatting)


def couple(pair):
    """
	Return True if RNA nucleotides are Watson-Crick base pairs
	"""
    pairs = {"A": "U", "U": "A", "G": "C", "C": "G"}  # ...or a list of tuples...

    # check if pair is couplable
    if pair in pairs.items():
        return True

    return False


def fill(nm, rna, list_of_nucleotides_not_to_consider):
    """
	Fill the matrix as per the Nussinov algorithm
	"""
    #bind index is in form of tuple for range not to consider

    minimal_loop_length = 0

    for k in range(1, len(rna)):
        for i in range(len(rna) - k):
            j = i + k

            if j - i >= minimal_loop_length:
                down = nm[i + 1][j]  # 1st rule
                left = nm[i][j - 1]  # 2nd rule

                if (i in list_of_nucleotides_not_to_consider) or (j in list_of_nucleotides_not_to_consider):
                    diag = 0
                else:
                    diag = nm[i + 1][j - 1] + couple((rna[i], rna[j]))  # 3rd rule

                rc = max([nm[i][t] + nm[t + 1][j] for t in range(i, j)])  # 4th rule

                nm[i][j] = max(down, left, diag, rc)  # max of all

            else:
                nm[i][j] = 0

    return nm

def alternate_traceback(nm, rna, initial_i, initial_j):
    """
	Alternate traceback through complete Nussinov matrix to find optimial RNA secondary structure solution
  Source: http://datamech.com/devan/nussinov-traceback.html
	"""

    trace_back_stack = [(initial_i, initial_j)]
    candidate_stack = []
    fold = []

    last_direction = None

    while len(trace_back_stack) != 0:

        tb_coords = trace_back_stack.pop()

        i, j = tb_coords[0], tb_coords[1]

        if i >= j:
            continue

        if nm[i][j] == nm[i + 1][j]:  # 1st rule
            candidate_stack.append(('down', i + 1, j))

        if nm[i][j] == nm[i][j - 1]:  # 2nd rule
            candidate_stack.append(('left', i, j - 1))

        if nm[i][j] == nm[i + 1][j - 1] + couple((rna[i], rna[j])):  # 3rd rule
            candidate_stack.append(('diagonal', i + 1, j - 1))

        if len(candidate_stack) == 0:
            last_direction = None
            for k in range(i + 1, j - 1):
                if nm[i][j] == nm[i, k] + nm[k + 1][j]:  # 4th rule
                    trace_back_stack.append((k + 1, j))
                    trace_back_stack.append((i, k))
                    break
        else:
            while len(candidate_stack) != 0:
                move = candidate_stack.pop()
                move_direction = move[0]
                coord1 = move[1]
                coord2 = move[2]
                if last_direction is None:
                    last_direction = move_direction
                if move_direction == last_direction:
                    trace_back_stack.append((coord1, coord2))
                    if move_direction == 'diagonal':
                        fold.append((i, j))
                    break
                else:
                    trace_back_stack.append((coord1, coord2))

    sorted_pairings = sorted(list(set([ tuple(sorted(f)) for f in fold ])))
    print('Set of possible pairings', sorted_pairings)

    import itertools
    combinations = []

    for L in range(len(sorted_pairings) + 1):
        for subset in itertools.combinations(sorted_pairings, L):
            combinations.append(subset)

    valid_combinations = []
    for c in combinations:
      clist = [item for sublist in c for item in sublist]
      if list(set(clist)) == sorted(clist):
        valid_combinations.append(clist)
      else:
        continue

    folds = []
    for c in valid_combinations:
      fold = []
      if len(c) >= 2:
        pair_lists = [c[x:x+2] for x in range(0, len(c), 2)]
        for pair in pair_lists:
          fold.append(tuple(pair))
      folds.append(fold)

    print("\n", 'Set of alternate traceback folds', folds)

    return folds


def dot_write(rna, fold):
    dot = ["." for i in range(len(rna))]

    for s in fold:
        # print(min(s), max(s))
        dot[min(s)] = "("
        dot[max(s)] = ")"

    return "".join(dot)


def init_matrix(rna):
    M = len(rna)

    # init matrix
    nm = np.empty([M, M])
    nm[:] = np.NAN

    # init diaganols to 0
    # few ways to do this: np.fill_diaganol(), np.diag(), nested loop, ...
    nm[range(M), range(M)] = 0
    nm[range(1, len(rna)), range(len(rna) - 1)] = 0

    return nm


if __name__ == "__main__":
    rna = "GGGAAAUCC"

    nm = init_matrix(rna)
    nm = fill(nm, rna, [])

    alternate_folds = alternate_traceback(nm, rna, 0, len(rna) - 1)

    for alternate_fold in alternate_folds:
      alternate_res = dot_write(rna, alternate_fold)
      print("\n", "\n", "alternate traceback fold:", "\n", alternate_fold, alternate_res)

    names = [_ for _ in rna]
    df = pd.DataFrame(nm, index=names, columns=names)

